  BigInt: { input: any; output: any; }
  COLUMN_JSON: { input: any; output: any; }
  Date: { input: any; output: any; }
  DateTime: { input: any; output: any; }
  DotString: { input: any; output: any; }
  IntStringBoolean: { input: any; output: any; }
  JSON: { input: any; output: any; }
  MultiTypeValue: { input: any; output: any; }
  Object: { input: any; output: any; }
  SearchValue: { input: any; output: any; }
  StringORInt: { input: any; output: any; }
  StringOrArrayOrNumberOrBoolean: { input: any; output: any; }
  StringOrIntOrArray: { input: any; output: any; }
  /** Accepts string, int, list, or dict JSON-like values. */
  StringOrIntOrList: { input: any; output: any; }
  StringOrNull: { input: any; output: any; }
  StringOrNumber: { input: any; output: any; }
  StringOrNumberOrArray: { input: any; output: any; }
